adastackz - RT @PineADApizza: Well I'm blown away by the #ERGO community. What a bunch of genuinely welcoming folk they are.

@ErgoWallet mobile setup was seamless and then I was met by helpful peeps to show me around the ecosystem.

Appreciate the help #ergonauts

